A participação de representantes do LNMRI/IRD/CNEN nas reuniões promovidas pelo ICRM é fundamental para o
desenvolvimento da Metrologia de Radionuclídeos no país, o que proporciona o aprimoramento das atividades desempenhadas
pelo LNMRI/IRD/CNEN, essenciais para a sua consolidação na Metrologia Internacional no âmbito do BIPM. O ICRM discute vários
temas relacionados aos seguintes grupos: Metrologia de Radionuclídeos em Ciências da Vida; Espectrometria de raios gama;
Técnicas de Medição de Radioatividade de Baixo Nível; Contagem de cintilação líquida; Técnicas de Metrologia de Radionuclídeos;
Dados de Decaimento Nuclear
